import React from 'react';
const ThuThuat = () => {

    return (
        <div>
            <h1>Thủ Thuật</h1>
            <p>Chức năng này đang được phát triển.</p>
            <p>Vui lòng quay lại sau.</p>
        </div>
    )
}
export default ThuThuat;
